import React from 'react';
import CreateTable from './CreateTable/CreateTable';
import PauseMenuImage from '../assets/pausemenu.png';

function GrassGrid(props) {
  return (
    <div className='grassTableContainer'>
      {console.log(props.isInPause)}
      <img className={props.isInPause ? 'inpauseMenu' : 'noinpauseMenu'} src={PauseMenuImage}></img>
      <CreateTable 
        columns={props.x} 
        rows={props.y} 
        playerPosition={props.playerPosition}>
      </CreateTable>
    </div>
  )
}

export default GrassGrid
